import React, { useState } from 'react';
import logo from './assets/care.webp';
import './styles/App.css';

function App() {
  const [query, setQuery] = useState('');
  const [operadoras, setOperadoras] = useState([]);

  const buscarOperadoras = async () => {
    try {
      const response = await fetch(`http://localhost:3000/search?query=operacao`);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setOperadoras(data);
    } catch (error) {
      console.error('Erro ao buscar operadoras:', error);
      setOperadoras([]); // Limpa os resultados em caso de erro
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <nav className="navbar">
          <div className="logo">Intuitive Care</div>
          <ul className="nav-links">
            <li><a href="#">Início</a></li>
            <li><a href="#">Sobre</a></li>
            <li><a href="#">Serviços</a></li>
            <li><a href="#">Contato</a></li>
          </ul>
        </nav>
      </header>

      <section className="operador">
        <div className="container">
          <div className="quadrado">
            <h1>Buscar Operadoras de Saúde</h1>
            <input
              type="text"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              placeholder="Digite o nome da operadora..."
            />
            <button onClick={buscarOperadoras}>Buscar</button>
            <ul>
              {operadoras.map((operadora) => (
                <li key={operadora.CNPJ}>
                  <strong>{operadora.NOME_OPERADORA}</strong>
                  <br />
                  CNPJ: {operadora.CNPJ}
                  <br />
                  Status: {operadora.STATUS_OPERADORA}
                </li>
              ))
              }
            </ul>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
